webpackJsonp([0xeaca043409ed],{617:function(a,e){a.exports={data:{markdownRemark:{html:'<h3>Mutual Disclosure of All Reports</h3>\n<p>All reports, including those marked as <i>Not Applicable</i>, <i>Duplicate</i>, and <i>Spam</i> can now be publicly disclosed when both the hacker and the program agree to disclose the report.</p>\n<h3>Request Mediation for Hackers</h3>\n<p>Hackers can now request mediation when they get into a disagreement with a program’s security team.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-8a9cb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.75824175824175%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="march_2016_mediation"\n        title=""\n        src="/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-2f183.png"\n        srcset="/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-67829.png 125w,\n/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-5c59f.png 250w,\n/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-2f183.png 500w,\n/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-c93e8.png 750w,\n/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-4e628.png 1000w,\n/static/march_2016_mediation-ae3643ba5ea76d2b2c0105f578dfbb61-8a9cb.png 1456w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Filter Directory by Programs Offering Bounties</h3>\n<p>Users can now filter the directory by programs offering bounties. Type <code>bounties:yes</code> into the search bar to only view the bounty programs in the directory.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-7a8b1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 32.375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="march_2016_filter_directory"\n        title=""\n        src="/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-2f183.png"\n        srcset="/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-67829.png 125w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-5c59f.png 250w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-2f183.png 500w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-c93e8.png 750w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-4e628.png 1000w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-b3ac4.png 1500w,\n/static/march_2016_filter_directory-5a5a1d3249193a70c736205a094a5e31-7a8b1.png 1600w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Threading for Notification Emails</h3>\n<p>We now support message threading for notification emails so that similar emails are grouped together.</p>\n<h3>Award Bonus</h3>\n<p>We introduce the ability for programs to award a structured bonus in addition to the standard bounty for a vulnerability. Read about it in our <a href="https://www.hackerone.com/blog/uber-launches-first-of-its-kind-hacker-loyalty-program-with-hackerone-bonuses">blog</a>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-5f78c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.70221327967807%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="march_2016_award_bonus"\n        title=""\n        src="/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-2f183.png"\n        srcset="/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-67829.png 125w,\n/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-5c59f.png 250w,\n/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-2f183.png 500w,\n/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-c93e8.png 750w,\n/static/march_2016_award_bonus-5351e7d98c7c338ca7d99eda85197a36-5f78c.png 994w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Improved Rate Limiter &#x26; Signal Requirements</h3>\n<p>We give programs the ability to tune the Rate Limiter by specifying minimum Signal Requirements for hacker participation. We’ve also updated the Rate Limiter to incorporate additional intelligent inputs.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-46996.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.37512537612839%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="march_2016_rate_limiter"\n        title=""\n        src="/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-2f183.png"\n        srcset="/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-67829.png 125w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-5c59f.png 250w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-2f183.png 500w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-c93e8.png 750w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-4e628.png 1000w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-b3ac4.png 1500w,\n/static/march_2016_improved_rate_limiter-049e40b54ec17e04a9f35fe974323193-46996.png 1994w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hacker Invitations by Priority</h3>\n<p>We’ve overhauled the hacker invitation process so that hackers with the highest Reputation, Signal, and Impact will have a greater likelihood of being invited to private programs. Read our <a href="https://www.hackerone.com/blog/fair-and-transparent-hacker-invitations">blog post</a> to learn more about how invitations work. </p>\n<h3>Inline Image Attachments</h3>\n<p>We enable programs and hackers to now add inline image attachments to reports and comments.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-315ca.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75.49295774647888%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="march_2016_inline_image"\n        title=""\n        src="/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-2f183.png"\n        srcset="/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-67829.png 125w,\n/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-5c59f.png 250w,\n/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-2f183.png 500w,\n/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-c93e8.png 750w,\n/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-4e628.png 1000w,\n/static/march_2016_inline_image_attacments-daed3ef2f1964fe38dc02b6dce23c25b-315ca.png 1420w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/changelog/2016/march",title:"March 2016"}}},pathContext:{}}}});
